function cadastraOrientadoraaaaaaaaaaa(){
    $conn = conecta();
    
    try {
        $sql = "SELECT nome_orientador, nome_coorientador, email_orientador, email_coorientador, cpf_orientador, cpf_coorientador FROM trabalhosAntigoBD";
        $stmt = $conn->prepare($sql);

        $stmt->execute();
        $result = $stmt->fetchAll(PDO::FETCH_ASSOC);

        /* echo '<pre>';
        print_r($result);
        echo '</pre>'; */

        foreach($result as $row){
            $sqlVerificacao = "SELECT cpf FROM orientador WHERE cpf = :cpf";
            $stmt = $conn->prepare($sqlVerificacao);
            $stmt->bindValue(':cpf', $row['cpf_orientador'], PDO::PARAM_STR);

            $stmt->execute();
            if(empty($stmt->fetch(PDO::FETCH_ASSOC))) {
                $sqlInsert = "INSERT INTO orientador(id, nome, email, cpf) VALUES (default, :nome, :email, :cpf)";
                $stmt = $conn->prepare($sqlInsert);
                $stmt->bindValue(":nome", $row["nome_orientador"], PDO::PARAM_STR);
                $stmt->bindValue(":email", $row["email_orientador"], PDO::PARAM_STR);
                $stmt->bindValue(":cpf", $row["cpf_orientador"], PDO::PARAM_STR);

                $stmt->execute();
            }

            if($row['cpf_coorientador'] != null){
                $sqlVerificacao = "SELECT cpf FROM orientador WHERE cpf = :cpf";
                $stmt = $conn->prepare($sqlVerificacao);
                $stmt->bindValue(':cpf', $row['cpf_coorientador'], PDO::PARAM_STR);
                
                $stmt->execute();
                if(empty($stmt->fetch(PDO::FETCH_ASSOC))) {
                    $sqlInsert = "INSERT INTO orientador(id, nome, email, cpf) VALUES (default, :nome, :email, :cpf)";
                    $stmt = $conn->prepare($sqlInsert);
                    $stmt->bindValue(":nome", $row["nome_coorientador"], PDO::PARAM_STR);
                    $stmt->bindValue(":email", $row["email_coorientador"], PDO::PARAM_STR);
                    $stmt->bindValue(":cpf", $row["cpf_coorientador"], PDO::PARAM_STR);

                    $stmt->execute();
                }
            }

        }

    } catch (PDOException $e) {
        echo '<br>Erro na função cadastraOrientador<br>';
        echo $e->getMessage();
    }
}

function cadastraTrabalhos(){
    $conn = conecta();
    
    try {
        $sql = "SELECT id, nivel, titulo, notaResumo, instituicao, ativo, id_area_de_conhecimento, id_tipo_de_pesquisa, cpf_orientador, cpf_coorientador FROM trabalhosAntigoBD";
        $stmt = $conn->prepare($sql);

        $stmt->execute();
        $result = $stmt->fetchAll(PDO::FETCH_ASSOC);

        /* echo '<pre>';
        print_r($result);
        echo '</pre>'; */

        foreach($result as $row){
            $sqlProcura = "SELECT id FROM orientador WHERE cpf = :cpf";
            $stmt = $conn->prepare($sqlProcura);

            $stmt->bindValue(':cpf', $row['cpf_orientador'], PDO::PARAM_STR);
            $stmt->execute();
            $idOrientador = $stmt->fetch(PDO::FETCH_ASSOC);

            if($row['cpf_coorientador'] != null){
                $sqlProcura = "SELECT id FROM orientador WHERE cpf = :cpf";
                $stmt = $conn->prepare($sqlProcura);

                $stmt->bindValue(':cpf', $row['cpf_coorientador'], PDO::PARAM_STR);
                $stmt->execute();
                $idCoorientador = $stmt->fetch(PDO::FETCH_ASSOC);

            }

            $sqlInsert = "INSERT INTO trabalho(id, nivel, titulo, notaResumo, instituicao, ativo, id_area_de_conhecimento, id_orientador, id_coorientador, id_tipo_de_pesquisa) VALUES (:id, :nivel, :titulo, :notaResumo, :instituicao, :ativo, :id_area_de_conhecimento, :id_orientador, :id_coorientador, :id_tipo_de_pesquisa)";
            $stmt = $conn->prepare($sqlInsert);

            $stmt->bindValue(':id', $row['id'], PDO::PARAM_STR);
            $stmt->bindValue(':nivel', $row['nivel'], PDO::PARAM_STR);
            $stmt->bindValue(':titulo', $row['titulo'], PDO::PARAM_STR);
            $stmt->bindValue(':notaResumo', $row['notaResumo'], PDO::PARAM_STR);
            $stmt->bindValue(':instituicao', $row['instituicao'], PDO::PARAM_STR);
            $stmt->bindValue(':ativo', $row['ativo'], PDO::PARAM_STR);
            $stmt->bindValue(':id_area_de_conhecimento', $row['id_area_de_conhecimento'], PDO::PARAM_STR);
            $stmt->bindValue(':id_orientador', $idOrientador['id'], PDO::PARAM_STR);
            $stmt->bindValue(':id_coorientador', $idCoorientador['id'], PDO::PARAM_STR);
            $stmt->bindValue(':id_tipo_de_pesquisa', $row['id_tipo_de_pesquisa'], PDO::PARAM_STR);

            $stmt->execute();
        }

    } catch (PDOException $e) {
        echo '<br>Erro na função cadastraTrabalho<br>';
        echo $e->getMessage();
    }
} 

function cadastraEstudantesTrabalho(){
    $conn = conecta();
    
