        $sql = "SELECT id, estudantes FROM trabalhosAntigoBD";
        $stmt = $conn->prepare($sql);

        $stmt->execute();
        $result = $stmt->fetchAll(PDO::FETCH_ASSOC);

        /* echo '<pre>';
        print_r($result);
        echo '</pre>'; */

        $id = 1;

        foreach($result as $row){
            //! Problema, os nomes que não são primeiro de cada trabalho está ficando com espaço no começo no bd
            $estudantes = explode(";",$row["estudantes"]);
            foreach($estudantes as $nome){
                $sqlInsert = "INSERT INTO estudante(id, nome, cpf) VALUES (:id, :nome, '00000000000')";
                $stmt = $conn->prepare($sqlInsert);
                $stmt->bindValue(':id', $id, PDO::PARAM_STR);
                $stmt->bindValue(':nome', $nome, PDO::PARAM_STR);

                $stmt->execute();

                $sqlInsertEstudantesTrabalhos = "INSERT INTO estudante_trabalho(id, id_estudante, id_trabalho) VALUES (default, :idEstudante, :idTrabalho)";
                $stmt = $conn->prepare($sqlInsertEstudantesTrabalhos);
                $stmt->bindValue(':idEstudante', $id, PDO::PARAM_STR);
                $stmt->bindValue(':idTrabalho', $row['id'], PDO::PARAM_STR);
                
                $stmt->execute();

                $id++;
            }
        }

